import React, { useEffect, useState } from "react";
import { Button, Form, Input } from "antd";
import "./supplier.css";
import { getData } from "../../api";
import { getSupplier } from "../../api/index.js";

const Supplier = () => {
  const [supplierData, setSupplierData] = useState([]);

  const getSupplierData = () => {
    getSupplier()
      .then((res) => {
        console.log(res.data, "res");
        setSupplierData(res.data); // Assuming res.data contains the supplier list
      })
      .catch((error) => {
        console.error(error);
      });
  };

  useEffect(() => {
    getSupplierData();
  }, []);

  const handleClick = () => {
    // Implement adding a new supplier
  };

  // submit
  const handleFinisch = (e) => {
    setSupplierData({
      name: e.name,
    });
    console.log(e);
  };

  return (
    <div className="supplier">
      <div className="flex-box space-between">
        <Button
          type="primary"
          onClick={() => {
            handleClick("add");
          }}
        >
          +Add Supplier
        </Button>
        <Form layout="inline" onFinish={handleFinisch}>
          <Form.Item name="keyword">
            <Input placeholder="Please enter supplier name"></Input>
          </Form.Item>
          <Form.Item>
            <Button htmlType="submit" type="primary">
              Search
            </Button>
          </Form.Item>
        </Form>
      </div>
      <div></div>
    </div>
  );
};

export default Supplier;
